import React from 'react'
import { Container, Row, Col, Button } from "reactstrap";
import { NavLink, Link } from "react-router-dom";

import logo from '../../assets/images/logo.png';
import './header.css';

const nav__links =[
  {
    path:'/home',
    display:'Home'
  },
  {
    path:'/about',
    display:'About'
  },
  {
    path:'/tours',
    display:'Tours'
  },
]

const Header = () => {
  return <header className="header">
    <Container>
      <Row className="align-items-center justify-content-between">
        <Col md={3}>
          <div className="logo">
            <img src={logo} alt="" />
          </div>
        </Col>
        <Col md={6}>
          <ul className="menu d-flex align-items-center justify-content-end gap-5">
            {nav__links.map((item,index) => (
              <li className="nav__item"  key={index}>
                <NavLink to={ item.path} className={navClass => 
                navClass.isActive ? "active__link" : ""}>  { item.display} </NavLink>
              </li>
            ))}
          </ul>
        </Col>
        <Col md={3}>
          <div className="nav__right d-flex align-items-center justify-content-end gap-4">
            <div className="nav__btns d-flex align-items-center gap-4">
              <Button className="btn secondary__btn"><Link to='/login'> Login </Link></Button>
              <Button className="btn primary__btn"> <Link to='/register'> Register </Link></Button>
            </div>

            <span className="mobile__menu"><i class="ri-menu-line"></i></span>
          </div>
        </Col>
      </Row>
    </Container>
  </header>
};

export default Header;
